        index = 0
        while done == False:
            #Probar caracter por carcter hasta encontrar el token mas grande
            i = index
            passedAccepted = []
            
            currentChain = ''
            lastAccepted = 0
            lastToken = ''
            empty = False
            maybeKeyword = False
