def simulateWord(graph, opc, keywords, tokenStates):
    # Simular una palabra
    found = False
    for i in keywords:
        if opc == i[1]:
            return [i[0], 's1']

    if found != True:
        cadena = list(opc)
        if len(cadena) == 0:
            if 's0' in graph['accepting_states']:
                for i in tokenStates:
                    if i[0] == 's0':
                        return [i[1], 's1']
            else:
                return ["NO ES ACEPTADO POR LA GRAMATICA", 's0']
        else:
            s = 's0'
            c = cadena[0]
            i = 0
            cadena.append('eof')
            while (c != 'eof'):
                cambio = False
                # Mover(s,c)
                for j in graph['transitions']:
                    if j[0] == s and j[1] == c:
                        s = j[2]
                        cambio = True
                        break
                if cambio == False:
                    break
                # Siguiente caracter
                i+=1
                c = cadena[i]
            if (s in graph['accepting_states'] and cambio):
                for i in tokenStates:
                    if i[0] == s:
                        return [i[1], s]
            else:
                return ["NO ES ACEPTADO POR LA GRAMATICA", s]

